    __webpack_exports__["default"] = "<!--copied from parkzapp yii web app-->\n\n<div class=\"privacy-content\">\n  <div>\n    <mat-card>\n      <h2 style=\"color: #0A837E;text-align:center;font-size: 30px;padding-bottom:3%\">ParkZapp.com Privacy Policy</h2>\n      <p style=\"text-align: justify;\">This privacy policy has been compiled to better serve those who are concerned with how their 'Personally identifiable\n        information' (PII) is being used online. PII, as used in US privacy law and information security, is information\n        that can be used on its own or with other information to identify, contact, or locate a single person, or to identify\n        an individual in context. Please read our privacy policy carefully to get a clear understanding of how we collect,\n        use, protect or otherwise handle your Personally Identifiable Information in accordance with our website.</p>\n    </mat-card>\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">What personal information do we collect from the people that visit our blog, website or app?</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">When ordering or registering on our site, as appropriate, you may be asked to enter your name, email address, mailing\n        address, phone number or other details to help you with your experience.</p>\n    </mat-card>\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">When do we collect information?</h3>\n      <p style=\"text-align: justify;\">We collect information from you when you register on our site, place an order or enter information on our site. How\n        do we use your information? We may use the information we collect from you when you register, make a purchase, sign\n        up for our newsletter, respond to a survey or marketing communication, surf the website, or use certain other site\n        features in the following ways: <br>\n      </p>\n      <li style=\"text-align: justify;padding-bottom: 2%;\">\n        To personalize user's experience and to allow us to deliver the type of content and product offerings in which you are most\n        interested.\n      </li>\n      <p></p>\n    </mat-card>\n\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">How do we protect visitor information?</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">Our website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit\n        to our site as safe as possible. We only provide articles and information. We never ask for personal or private information\n        like email addresses or credit card numbers. We use regular Malware Scanning.<br><br> Your personal information is\n        contained behind secured networks and is only accessible by a limited number of persons who have special access rights\n        to such systems, and are required to keep the information confidential. In addition, all sensitive/credit information\n        you supply is encrypted via Secure Socket Layer (SSL) technology.<br><br> We implement a variety of security measures\n        when a user places an order enters, submits, or accesses their information to maintain the safety of your personal\n        information.\n        <br><br> All transactions are processed through a gateway provider and are not stored or processed on our servers.\n      </p>\n\n    </mat-card>\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">Do we use 'cookies'?</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">We do not use cookies for tracking purposes <br><br> You can choose to have your computer warn you each time a cookie\n        is being sent, or you can choose to turn off all cookies. You do this through your browser (like Internet Explorer)\n        settings. Each browser is a little different, so look at your browser's Help menu to learn the correct way to modify\n        your cookies.<br><br> If you disable cookies off, some features will be disabled that make your site experience more\n        efficient and some of our services will not function properly. <br><br> However, you can still place orders .\n      </p>\n    </mat-card>\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">Third-party disclosure</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information.</p>\n    </mat-card>\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">Third-party links</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">We do not include or offer third-party products or services on our website.</p>\n\n    </mat-card>\n\n    <br/>\n    <mat-card>\n\n      <h3 style=\"color: #0A837E;font-size: 23px;\">Google</h3>\n      <p style=\"padding-bottom: 2%;\">Google's advertising requirements can be summed up by Google's Advertising Principles. They are put in place to provide\n        a positive experience for users. https://support.google.com/adwordspolicy/answer/1316548?hl=en <br><br> We have not\n        enabled Google AdSense on our site but we may do so in the future.</p>\n    </mat-card>\n    <br/>\n    <mat-card>\n\n\n      <h3 style=\"color: #0A837E;font-size: 23px;\">California Online Privacy Protection Act</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">CalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy.\n        The law's reach stretches well beyond California to require a person or company in the United States (and conceivably\n        the world) that operates websites collecting personally identifiable information from California consumers to post\n        a conspicuous privacy policy on its website stating exactly the information being collected and those individuals\n        with whom it is being shared, and to comply with this policy. - See more at: http://consumercal.org/california-online-privacy-protection-act-caloppa/#sthash.0FdRbT51.dpuf</p>\n    </mat-card>\n    <br/>\n    <mat-card>\n\n\n      <h3 style=\"color: #0A837E;font-size: 23px;\">According to CalOPPA we agree to the following:</h3>\n      <p style=\"text-align: justify;\">Users can visit our site anonymously.<br><br> Once this privacy policy is created, we will add a link to it on our\n        home page or as a minimum on the first significant page after entering our website.<br><br> Our Privacy Policy link\n        includes the word 'Privacy' and can be easily be found on the page specified above. <br><br> Users will be notified\n        of any privacy policy changes:\n      </p>\n      <li>On our Privacy Policy Page</li><br> Users are able to change their personal information:<br><br>\n      <li style=\"text-align: justify;padding-bottom: 2%;\">By logging in to their account</li>\n      <p></p>\n    </mat-card>\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">How does our site handle do not track signals?</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">We honor do not track signals and do not track, plant cookies, or use advertising when a Do Not Track (DNT) browser\n        mechanism is in place.</p>\n      <p>\n\n\n\n\n      </p>\n    </mat-card>\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">Does our site allow third-party behavioral tracking?</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">It's also important to note that we do not allow third-party behavioral tracking</p>\n    </mat-card>\n\n    <br/>\n    <mat-card>\n\n\n      <h3 style=\"color: #0A837E;font-size: 23px;\">COPPA (Children Online Privacy Protection Act)</h3>\n      <p>When it comes to the collection of personal information from children under 13, the Children's Online Privacy Protection\n        Act (COPPA) puts parents in control. The Federal Trade Commission, the nation's consumer protection agency, enforces\n        the COPPA Rule, which spells out what operators of websites and online services must do to protect children's privacy\n        and safety online.</p>\n\n      <p style=\"text-align: justify;padding-bottom: 2%;\">We do not specifically market to children under 13.</p>\n    </mat-card>\n\n    <br/>\n    <mat-card>\n\n\n\n      <h3 style=\"color: #0A837E;font-size: 23px;\">CAN SPAM Act</h3>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">The CAN-SPAM Act is a law that sets the rules for commercial email, establishes requirements for commercial messages,\n        gives recipients the right to have emails stopped from being sent to them, and spells out tough penalties for violations.</p>\n    </mat-card>\n\n    <h3 style=\"color: #0A837E;font-size: 23px;padding-bottom: 2%;\">We collect your email address in order to:</h3>\n\n\n    <br/>\n    <mat-card>\n      <h3 style=\"color: #0A837E;font-size: 23px;\">To be in accordance with CANSPAM we agree to the following:</h3>\n\n\n      <p><b>If at any time you would like to unsubscribe from receiving future emails, you can email us at </b></p>\n      <p>\n\n      </p>\n      <p style=\"text-align: justify;padding-bottom: 2%;\">and we will promptly remove you from <b>ALL</b> correspondence</p>\n    </mat-card>\n\n    <h3 style=\"color: #0A837E;font-size: 23px;\">Contacting Us</h3>\n    <br/>\n    <mat-card>\n      <h4 style=\"font-size: 20px;\">If there are any questions regarding this privacy policy you may contact us using the information below.\n\n      </h4>\n      <h4>\n\n      </h4>\n      <h4 style=\"font-size: 18px;\">parkzapp.com</h4>\n      <h4 style=\"font-size: 18px;\">5730 NW 4th CT</h4>\n      <h4 style=\"font-size: 18px;\">Des Moines, IA 50313</h4>\n      <h4 style=\"font-size: 18px;\">U.S.</h4>\n      <h4 style=\"font-size: 18px;\">contact@zamorinstech.com</h4>\n      <h4 style=\"font-size: 18px;\">Last Edited on 2016-04-17</h4>\n    </mat-card>\n  </div>\n\n</div>\n";
    /***/
